Banner print(Environment environment, Class<?> sourceClass, Log logger) {
	Banner banner = getBanner(environment);
	try {
		logger.info(createStringFromBanner(banner, environment, sourceClass));
	}
	catch (UnsupportedEncodingException ex) {
		logger.warn("Failed to create String for banner", ex);
	}
	return new PrintedBanner(banner, sourceClass);
}

Banner print(Environment environment, Class<?> sourceClass, PrintStream out) {
	Banner banner = getBanner(environment);
	banner.printBanner(environment, sourceClass, out);
	return new PrintedBanner(banner, sourceClass);
}

private Banner getBanner(Environment environment) {
	Banners banners = new Banners();
	banners.addIfNotNull(getImageBanner(environment));
	banners.addIfNotNull(getTextBanner(environment));
	if (banners.hasAtLeastOneBanner()) {
		return banners;
	}
	if (this.fallbackBanner != null) {
		return this.fallbackBanner;
	}
	return DEFAULT_BANNER;
}

private Banner getTextBanner(Environment environment) {
	String location = environment.getProperty(BANNER_LOCATION_PROPERTY, DEFAULT_BANNER_LOCATION);
	Resource resource = this.resourceLoader.getResource(location);
	if (resource.exists()) {
		return new ResourceBanner(resource);
	}
	return null;
}

private Banner getImageBanner(Environment environment) {
	String location = environment.getProperty(BANNER_IMAGE_LOCATION_PROPERTY);
	if (StringUtils.hasLength(location)) {
		Resource resource = this.resourceLoader.getResource(location);
		return resource.exists() ? new ImageBanner(resource) : null;
	}
	for (String ext : IMAGE_EXTENSION) {
		Resource resource = this.resourceLoader.getResource("banner." + ext);
		if (resource.exists()) {
			return new ImageBanner(resource);
		}
	}
	return null;
}

private String createStringFromBanner(Banner banner, Environment environment, Class<?> mainApplicationClass)
		throws UnsupportedEncodingException {
	ByteArrayOutputStream baos = new ByteArrayOutputStream();
	banner.printBanner(environment, mainApplicationClass, new PrintStream(baos));
	String charset = environment.getProperty("spring.banner.charset", "UTF-8");
	return baos.toString(charset);
}

void addIfNotNull(Banner banner) {
	if (banner != null) {
		this.banners.add(banner);
	}
}

boolean hasAtLeastOneBanner() {
	return !this.banners.isEmpty();
}

public void printBanner(Environment environment, Class<?> sourceClass, PrintStream out) {
	for (Banner banner : this.banners) {
		banner.printBanner(environment, sourceClass, out);
	}
}

public void printBanner(Environment environment, Class<?> sourceClass, PrintStream out) {
	sourceClass = (sourceClass != null) ? sourceClass : this.sourceClass;
	this.banner.printBanner(environment, sourceClass, out);
}

private Boolean find(){
    boolean state=false;

    ArrayList<Integer> res=new editUtil().changPos(edit.getText(),edit.getCaretPosition());
    int line=res.get(0)-1; int pos=res.get(1)-1;


    /*从起始位置向下搜索*/
    for(int i=line;i<list.length;i++){
        if(i==line){
            Pending=list[i].substring(pos,list[i].length());

        }else
            Pending=list[i];

        if(get()){
            state=true;
            posRow=i;
            break;
        }
    }
    /*从开始向起始位置搜索*/
    if(!state)/*从起始位置向下搜索未找到，此时计数器归零*/
        counter=0;
    for(int i=0;i<=line;i++){
        if(state){
            if(i==line)
                counter+=list[i].substring(0,pos).length();
            else
                counter+=list[i].length()+1;
        }else {


            Pending=list[i];

            if(get()){
                state=true;
                posRow=i;
                return state;
            }

        }
    }

    return state;
}

private boolean get(){
    /*如开启了过滤时间轴，校验并跳过时间轴行*/
    if(filterState&&new TimelineUtil(controller.inputset.getSubType()).TimelineCheck(Pending)){
        counter+=Pending.length()+1;
        return false;
    }
    /*如未开启区分大小写，统一转换为小写*/
    if(!caseState){
        Pending=Pending.toLowerCase();
        if(!regState)
            target=target.toLowerCase();
    }
    /*如开启了正则表达式，则搜索使用该正则*/
    if(!regState)
        pattern="(.*?)("+target+")";
    /*使用正则进行搜索*/
    r = Pattern.compile(pattern);
    m = r.matcher(Pending);
    if(!m.find()){
        counter+=Pending.length()+1;
        return false;
    }
    else{

        if(regState){

            target = m.group();
            posCol=m.end();
        }
        else
            posCol=m.end(2);

        counter+=posCol;
        posCol-=target.length();
        return true;
    }
}

public Boolean search(){
    boolean state=find();
    if(state)
        edit.selectRange(counter-target.length(),counter);

    return state;
}

public Boolean replace(String ReplaceTarget){
    this.ReplaceTarget=ReplaceTarget;
    String str="";
    boolean state=find();
    if(state){

        for(int i=0;i<list.length;i++){
            if(i==posRow){
                String before,after="";
                before=list[i].substring(0,posCol);
                after=list[i].substring(posCol,list[i].length());
                String temp=before+r.matcher(after).replaceFirst(ReplaceTarget)+"\n";
                str+=temp;
                System.out.println("替换后的行："+temp);
            }else
                str+=list[i]+"\n";
    }
        edit.setText(str);
        edit.selectRange(counter-target.length(),counter-target.length()+ReplaceTarget.length());
    }
    return state;
}

public boolean replaceAll(String ReplaceTarget){
    this.ReplaceTarget=ReplaceTarget;
    String str="";
    boolean state=find();
    if(state){
        str=edit.getText().replaceAll(target,ReplaceTarget);
        edit.setText(str);
        return true;
    }
    return false;
}

private void subscribeUpdateChecking() {
    if (updatingViewModel.getUpdateManifest().getValue() != null) {
        UpdateManifest manifest = updatingViewModel.getUpdateManifest().getValue();
        onUpdatingDetect(manifest);
    } else {
        updatingViewModel.getUpdateManifest().observe(mActivity, updateManifest -> {
            if (updateManifest != null) {
                onUpdatingDetect(updateManifest);
            }
        });
    }
}

