    textureArea.add(tab2Area);

    x0 += (tabW+gap);
    drawTab(g,x0,0,tabW,h,milLabel, exploitBox, selectedTab.equals(exploitTab));
    Area tab3Area = new Area(new RoundRectangle2D.Float(x0,s10,tabW,h-s10,h/4,h/4));
