public boolean onTouch(View v, MotionEvent event) {

    int id = v.getId();
    float x = event.getX();
    float y = event.getY();

    if (mIfCurrentIsFullscreen && mLockCurScreen && mNeedLockFull) {
        onClickUiToggle();
        startDismissControlViewTimer();
        return true;
    }

    if (id == R.id.fullscreen) {
        return false;
    }

    if (id == R.id.surface_container) {
        switch (event.getAction()) {
            case MotionEvent.ACTION_DOWN:

                touchSurfaceDown(x, y);

                break;
            case MotionEvent.ACTION_MOVE:
                float deltaX = x - mDownX;
                float deltaY = y - mDownY;
                float absDeltaX = Math.abs(deltaX);
                float absDeltaY = Math.abs(deltaY);

                if ((mIfCurrentIsFullscreen && mIsTouchWigetFull)
                        || (mIsTouchWiget && !mIfCurrentIsFullscreen)) {
                    if (!mChangePosition && !mChangeVolume && !mBrightness) {
                        touchSurfaceMoveFullLogic(absDeltaX, absDeltaY);
                    }
                }
                touchSurfaceMove(deltaX, deltaY, y);

                break;
            case MotionEvent.ACTION_UP:

                startDismissControlViewTimer();

                touchSurfaceUp();


                Debuger.printfLog(GSYVideoControlView.this.hashCode() + "------------------------------ surface_container ACTION_UP");

                startProgressTimer();

                //不要和隐藏虚拟按键后，滑出虚拟按键冲突
                if (mHideKey && mShowVKey) {
                    return true;
                }
                break;
        }
        gestureDetector.onTouchEvent(event);
    } else if (id == R.id.progress) {
        switch (event.getAction()) {
            case MotionEvent.ACTION_DOWN:
                cancelDismissControlViewTimer();
            case MotionEvent.ACTION_MOVE:
                cancelProgressTimer();
                ViewParent vpdown = getParent();
                while (vpdown != null) {
                    vpdown.requestDisallowInterceptTouchEvent(true);
                    vpdown = vpdown.getParent();
                }
                break;
            case MotionEvent.ACTION_UP:
                startDismissControlViewTimer();

                Debuger.printfLog(GSYVideoControlView.this.hashCode() + "------------------------------ progress ACTION_UP");
                startProgressTimer();
                ViewParent vpup = getParent();
                while (vpup != null) {
                    vpup.requestDisallowInterceptTouchEvent(false);
                    vpup = vpup.getParent();
                }
                mBrightnessData = -1f;
                break;
        }
    }

    return false;
}

