public static Decoder getDecoderFromDevice() {
    /*
     * Try first blacklisted decoders (for all android versions)
     */
    for (DecoderBySOC decBySOC : sBlacklistedDecoderBySOCList) {
        final String prop = getSystemPropertyCached(decBySOC.key);
        if (prop != null) {
            if (prop.contains(decBySOC.value))
                return decBySOC.dec;
        }
    }
    /*
     * Always try MediaCodec after JellyBean MR2,
     * Try OMX or MediaCodec after HoneyComb depending on device properties.
     * Otherwise, use software decoder by default.
     */
    if (AndroidUtil.isJellyBeanMR2OrLater())
        return Decoder.ALL;
    else if (AndroidUtil.isHoneycombOrLater()) {
        for (DecoderBySOC decBySOC : sDecoderBySOCList) {
            final String prop = getSystemPropertyCached(decBySOC.key);
            if (prop != null) {
                if (prop.contains(decBySOC.value))
                    return decBySOC.dec;
            }
        }
    }
    return Decoder.UNKNOWN;
}

public static AudioOutput getAudioOutputFromDevice() {
    if (!AndroidUtil.isGingerbreadOrLater()) {
        return AudioOutput.AUDIOTRACK;
    } else {
        for (AudioOutputBySOC aoutBySOC : sAudioOutputBySOCList) {
            final String prop = getSystemPropertyCached(aoutBySOC.key);
            if (prop != null) {
                if (prop.contains(aoutBySOC.value))
                    return aoutBySOC.aout;
            }
        }
        return AudioOutput.ALL;
    }
}

private static String getSystemPropertyCached(String key) {
    String prop = sSystemPropertyMap.get(key);
    if (prop == null) {
        prop = getSystemProperty(key, "none");
        sSystemPropertyMap.put(key, prop);
    }
    return prop;
}

private static String getSystemProperty(String key, String def) {
    try {
        final ClassLoader cl = ClassLoader.getSystemClassLoader();
        final Class<?> SystemProperties = cl.loadClass("android.os.SystemProperties");
        final Class<?>[] paramTypes = new Class[] { String.class, String.class };
        final Method get = SystemProperties.getMethod("get", paramTypes);
        final Object[] params = new Object[] { key, def };
        return (String) get.invoke(SystemProperties, params);
    } catch (Exception e){
        return def;
    }
}

public void install(RoleEnum role, InitConfigEntity configEntity) {
    List<String> allMyIps = NetUtil.getLocalIPList();

    Map<RoleEnum, List<ServerEntity>> rolesMap = this.rolesBiz.getRolesMap();
    List<ServerEntity> serverList = rolesMap.get(role);

    boolean first = true;
    for (ServerEntity server : serverList) {
        if (server.getStatus() != InstallStatusEnum.SUCCESS) {
            // 如果主节点也是此角色，则先安装
            int initCount = 1;
            if (allMyIps.stream().anyMatch(ip -> ip.equals(server.getHost()))) {
                Map<String, String> hosts = environmentService.getRoleNeedSetHost(role, configEntity);

                if (startRole(role, server.getRolePorts(), hosts, null)) {
                    server.setStatus(InstallStatusEnum.SUCCESS);
                }
                InstallResult result = new InstallResult();
                result.setRole(server.getRole());
                result.setSuccess(true);
                updateInstallResult(server.getHost(), result, configEntity);
            } else {
                //设置重试次数初始化值
                int retryCount = 1;
                //设置重试次数
                int retryTotal = 10;
                // 发送安装指令给从节点
                do {
                    HttpInstallResponse response = remoteService.sendInstallCommand(server, role, null, configEntity);
                    if (ResponseCode.SUCCESS.getCode().equals(response.getCode())) {
                        // log.warn(String.format("发送安装指令给 %s 节点安装 %s 成功", server.getHost(), role.name().toLowerCase()));
                        log.warn(String.format("Send installation instructions to %s node to install %s successfully", server.getHost(), role.name().toLowerCase()));
                        server.setStatus(InstallStatusEnum.INSTALLING);
                        break;
                    }
                    if (retryCount == retryTotal) {
                        break;
                    }
                    // log.warn(String.format("发送安装指令给 %s 节点安装 %s 失败，稍后重试...", server.getHost(), role.name().toLowerCase()));
                    log.warn(String.format("Failed to sending installation instructions to %s node  to install %s, try again later...", server.getHost(), role.name().toLowerCase()));
                    try {
                        Thread.sleep(3000);
                    } catch (InterruptedException e) {
                        e.printStackTrace();
                    }
                    retryCount++;
                } while (true);
            }
        }
    }

    // 等待完成安装
    int checkCount = 1;
    int checkTotal = 10;
    while (serverList.stream().anyMatch(s -> s.getStatus() != InstallStatusEnum.SUCCESS)) {
        if (checkCount == checkTotal) {
            break;
        }
        // log.info(String.format("等待所有 %s 节点完成安装...", role.name().toLowerCase()));
        log.info(String.format("Wait for all %s nodes to complete the installation...", role.name().toLowerCase()));
        try {
            Thread.sleep(10000);
        } catch (InterruptedException e) {
            e.printStackTrace();
        }
        checkCount++;
    }
}

