public char next() throws IOException {
    if (!hasNext()) {
        return EOF;
    }

    return buffer[++pos];
}

public boolean hasNext() throws IOException {
    if (pos < size - 1) {
        return true;
    }

    // 填充缓冲池
    int n = reader.read(buffer);
    if (n == -1) return false;

    // 指针复位、大小重置
    pos  = -1;
    size = n;

    return pos < size - 1;
}

public char peek() {
    if (pos >= size) {
        return EOF;
    }

    return buffer[Math.max(0, pos)];
}

public void skipWhite() throws IOException {
    char c = next();

    while (Character.isWhitespace(c)) {
        c = next();
    }

    if (c != EOF) back();
}

public void back() {
    pos = Math.max(--pos, -1); // pos至少为-1
}

public boolean matchNextAndSkip(@NotNull String match) throws IOException {

    for (int i = 0, size = match.length(); i < size; i++) {
        if (!hasNext()) return false;

        char c = next();
        char m = match.charAt(i);
        if (c != m) {
            return false;
        }
    }

    return true;
}

