public void createAudio(String fileName, int audioSource, int sampleRateInHz, int channelConfig, int audioFormat) {
    // 获得缓冲区字节大小
    bufferSizeInBytes = AudioRecord.getMinBufferSize(sampleRateInHz,
            channelConfig, channelConfig);
    audioRecord = new AudioRecord(audioSource, sampleRateInHz, channelConfig, audioFormat, bufferSizeInBytes);
    this.fileName = fileName;
}

public void createDefaultAudio(String fileName) {
    // 获得缓冲区字节大小
    bufferSizeInBytes = AudioRecord.getMinBufferSize(AUDIO_SAMPLE_RATE,
            AUDIO_CHANNEL, AUDIO_ENCODING);
    audioRecord = new AudioRecord(AUDIO_INPUT, AUDIO_SAMPLE_RATE, AUDIO_CHANNEL, AUDIO_ENCODING, bufferSizeInBytes);
    this.fileName = fileName;
    status = Status.STATUS_READY;
}

public void startRecord(final RecordStreamListener listener) {

    if (status == Status.STATUS_NO_READY || TextUtils.isEmpty(fileName)) {
        throw new IllegalStateException("录音尚未初始化,请检查是否禁止了录音权限~");
    }
    if (status == Status.STATUS_START) {
        throw new IllegalStateException("正在录音");
    }
    Log.d("AudioRecorder", "===startRecord===" + audioRecord.getState());
    audioRecord.startRecording();

    new Thread(new Runnable() {
        @Override
        public void run() {
            writeDataTOFile(listener);
        }
    }).start();
}

public void pauseRecord() {
    Log.d("AudioRecorder", "===pauseRecord===");
    if (status != Status.STATUS_START) {
        throw new IllegalStateException("没有在录音");
    } else {
        audioRecord.stop();
        status = Status.STATUS_PAUSE;
    }
}

public void stopRecord() {
    Log.d("AudioRecorder", "===stopRecord===");
    if (status == Status.STATUS_NO_READY || status == Status.STATUS_READY) {
        throw new IllegalStateException("录音尚未开始");
    } else {
        audioRecord.stop();
        status = Status.STATUS_STOP;
        release();
    }
}

public void release() {
    Log.d("AudioRecorder", "===release===");
    //假如有暂停录音
    try {
        if (filesName.size() > 0) {
            List<String> filePaths = new ArrayList<>();
            for (String fileName : filesName) {
                filePaths.add(FileUtil.getPcmFileAbsolutePath(fileName));
            }
            //清除
            filesName.clear();
            //将多个pcm文件转化为wav文件
            mergePCMFilesToWAVFile(filePaths);

        } else {
            //这里由于只要录音过filesName.size都会大于0,没录音时fileName为null
            //会报空指针 NullPointerException
            // 将单个pcm文件转化为wav文件
            //Log.d("AudioRecorder", "=====makePCMFileToWAVFile======");
            //makePCMFileToWAVFile();
        }
    } catch (IllegalStateException e) {
        throw new IllegalStateException(e.getMessage());
    }

    if (audioRecord != null) {
        audioRecord.release();
        audioRecord = null;
    }

    status = Status.STATUS_NO_READY;
}

public void canel() {
    filesName.clear();
    fileName = null;
    if (audioRecord != null) {
        audioRecord.release();
        audioRecord = null;
    }

    status = Status.STATUS_NO_READY;
}

private void writeDataTOFile(RecordStreamListener listener) {
    // new一个byte数组用来存一些字节数据，大小为缓冲区大小
    byte[] audiodata = new byte[bufferSizeInBytes];

    FileOutputStream fos = null;
    int readsize = 0;
    try {
        String currentFileName = fileName;
        if (status == Status.STATUS_PAUSE) {
            //假如是暂停录音 将文件名后面加个数字,防止重名文件内容被覆盖
            currentFileName += filesName.size();

        }
        filesName.add(currentFileName);
        File file = new File(FileUtil.getPcmFileAbsolutePath(currentFileName));
        if (file.exists()) {
            file.delete();
        }
        fos = new FileOutputStream(file);// 建立一个可存取字节的文件
    } catch (IllegalStateException e) {
        Log.e("AudioRecorder", e.getMessage());
        throw new IllegalStateException(e.getMessage());
    } catch (FileNotFoundException e) {
        Log.e("AudioRecorder", e.getMessage());

    }
    //将录音状态设置成正在录音状态
    status = Status.STATUS_START;
    while (status == Status.STATUS_START) {
        readsize = audioRecord.read(audiodata, 0, bufferSizeInBytes);
        if (AudioRecord.ERROR_INVALID_OPERATION != readsize && fos != null) {
            try {
                fos.write(audiodata);
                if (listener != null) {
                    //用于拓展业务
                    listener.recordOfByte(audiodata, 0, audiodata.length);
                }
            } catch (IOException e) {
                Log.e("AudioRecorder", e.getMessage());
            }
        }
    }
    try {
        if (fos != null) {
            fos.close();// 关闭写入流
        }
    } catch (IOException e) {
        Log.e("AudioRecorder", e.getMessage());
    }
}

private void mergePCMFilesToWAVFile(final List<String> filePaths) {
    new Thread(new Runnable() {
        @Override
        public void run() {
            if (PcmToWav.mergePCMFilesToWAVFile(filePaths, FileUtil.getWavFileAbsolutePath(fileName))) {
                //操作成功
            } else {
                //操作失败
                Log.e("AudioRecorder", "mergePCMFilesToWAVFile fail");
                throw new IllegalStateException("mergePCMFilesToWAVFile fail");
            }
            fileName = null;
        }
    }).start();
}

private void makePCMFileToWAVFile() {
    new Thread(new Runnable() {
        @Override
        public void run() {
            if (PcmToWav.makePCMFileToWAVFile(FileUtil.getPcmFileAbsolutePath(fileName), FileUtil.getWavFileAbsolutePath(fileName), true)) {
                //操作成功
            } else {
                //操作失败
                Log.e("AudioRecorder", "makePCMFileToWAVFile fail");
                throw new IllegalStateException("makePCMFileToWAVFile fail");
            }
            fileName = null;
        }
    }).start();
}

