public static boolean equals( byte[] a, byte[] a2 )
{
	if( a == a2 )
	{
		return true;
	}
	else if( a == null || a2 == null )
	{
		return false;
	}

	int length = a.length;
	if( a2.length != length )
	{
		return false;
	}

	// более вероятно, что чаще адреса будут расходиться в конце, поэтому сравнивать на совпадение лучше с конца.
	for( int i = length - 1; i >= 0; i-- )
	{
		if( a[i] != a2[i] )
		{
			return false;
		}
	}

	return true;
}

