public boolean preHandle(HttpServletRequest request, HttpServletResponse response, Object handler) throws Exception {
    if(conf.enable()){
        boolean check = true;
        if(handler instanceof HandlerMethod){
            HandlerMethod handlerMethod = (HandlerMethod) handler;
            UserInfo userInfo = null;
            if(handlerMethod.getMethod().isAnnotationPresent(RequireRoles.class)){
                userInfo = userInfoService.selectByUsername(security.getUserName(request));
                check = checkIfMatchRole(handlerMethod.
                        getMethod().getAnnotation(RequireRoles.class), userInfo);
            }
            if(check && handlerMethod.getBeanType().isAnnotationPresent(RequireRoles.class)){
                if(null == userInfo){
                    userInfo = userInfoService.selectByUsername(security.getUserName(request));
                }
                check = checkIfMatchRole(handlerMethod.getBeanType()
                        .getAnnotation(RequireRoles.class), userInfo);
            }
        }
        if(!check){
            response.setStatus(HttpStatus.UNAUTHORIZED.value());
        }
        return check;
    }
    return true;
}

private boolean checkIfMatchRole(RequireRoles roles, UserInfo userInfo){
    UserRole[] userRoles = roles.value();
    Integer typeValue = userInfo.getUserType();
    if(null != typeValue){
        for(UserRole userRole : userRoles){
            if(typeValue <  userRole.getValue()){
                return false;
            }
        }
        return true;
    }
    return false;
}

public void run() {
    try {

        //Wait for client to be ready
        Thread.sleep(1000);

        Socket uploadTo = new Socket(client.getIP(), client.getServer().getMAIN_PORT() + 2);

        File file = new File(Utils.rebuildPath(
                String.format("%s\\DownloadedFiles\\%s\\%s",
                        System.getProperty("user.dir"),
                        message.getSender(),
                        message.getBody())
        ));

        DataOutputStream toClient = new DataOutputStream(uploadTo.getOutputStream());

        if (file.exists()) {

            logger.debug(String.format("Start uploading %s", file.getName()));

            if (!file.canRead())
                logger.error("File is not readable :)");

            RandomAccessFile randomAccessFile = new RandomAccessFile(file, "r");

            byte[] buffer = new byte[BUFFER_SIZE];

            while (randomAccessFile.read(buffer) != -1)
                toClient.write(buffer);

            randomAccessFile.close();

            logger.debug(String.format("%s uploaded successfully!", file.getName()));

        } else {
            logger.debug(String.format("%s doesn't exists :)", file.getName()));
            logger.debug(file.getAbsolutePath());
            client.sendMessageToClient(ServerMessageBuilder
                    .responseBuilder(FILE_REMOVED, String.format("%s doesn't exists :)", file.getName())));
        }

    } catch (IOException | SendingToClientWasFailed | InterruptedException e) {
        logger.error(e.getMessage());
    } finally {
        serverWorker.decreaseUploadInProgress();
    }
}

public void start() {
    //TODO: this method is too complex and should be refactored
    if (running)
        return;

    running = true;

    try {
        welcomeSocket = new ServerSocket(this.port);
    } catch (IOException ex) {
        ex.printStackTrace();
    }

    while (running) {
        if (welcomeSocket == null || welcomeSocket.isClosed()) {
            stop();
            break;
        }

        Socket connectionSocket = null;
        BufferedReader inFromClient = null;
        DataOutputStream outToClient = null;

        try {
            connectionSocket = welcomeSocket.accept();
        } catch (IOException ex) {
            ex.printStackTrace();
            // this socket may have been closed, so we'll stop
            stop();
            return;
        }

        String str = null;
        int c;
        StringBuilder sb = new StringBuilder();

        try {
            inFromClient = new BufferedReader(new InputStreamReader(connectionSocket.getInputStream()));

            while ((str = inFromClient.readLine()) != null) {
                if (str.equals("")) {
                    break;
                }
            }

            while ((c = inFromClient.read()) != -1) {
                sb.append((char)c);
                String temp = sb.toString();

                if (temp.endsWith("</envelope>"))
                    break;
            }
        } catch (IOException ex) {
            ex.printStackTrace();
        }

        String body = sb.toString();

        Log.d(Util.T, "got message body: " + body);

        Calendar calendar = Calendar.getInstance();
        SimpleDateFormat dateFormat = new SimpleDateFormat("EEE, dd MMM yyyy HH:mm:ss z", Locale.US);
        dateFormat.setTimeZone(TimeZone.getTimeZone("GMT"));
        String date = dateFormat.format(calendar.getTime());
        String androidOSVersion = android.os.Build.VERSION.RELEASE;

        PrintWriter out = null;

        try {
            outToClient = new DataOutputStream(connectionSocket.getOutputStream());
            out = new PrintWriter(outToClient);
            out.println("HTTP/1.1 200 OK");
            out.println("Server: Android/" + androidOSVersion + " UDAP/2.0 ConnectSDK/1.2.1");
            out.println("Cache-Control: no-store, no-cache, must-revalidate");
            out.println("Date: " + date);
            out.println("Connection: Close");
            out.println("Content-Length: 0");
            out.println();
            out.flush();
        } catch (IOException ex) {
            ex.printStackTrace();
        } finally {
            try {
                inFromClient.close();
                out.close();
                outToClient.close();
                connectionSocket.close();
            } catch (IOException ex) {
                ex.printStackTrace();
            }
        }

        SAXParserFactory saxParserFactory = SAXParserFactory.newInstance();
        InputStream stream = null;

        try {
            stream = new ByteArrayInputStream(body.getBytes("UTF-8"));
        } catch (UnsupportedEncodingException ex) {
            ex.printStackTrace();
        }

        NetcastPOSTRequestParser handler = new NetcastPOSTRequestParser();

        SAXParser saxParser;
        try {
            saxParser = saxParserFactory.newSAXParser();
            saxParser.parse(stream, handler);
        } catch (IOException ex) {
            ex.printStackTrace();
        } catch (ParserConfigurationException e) {
            e.printStackTrace();
        } catch (SAXException e) {
            e.printStackTrace();
        }

        if (body.contains("ChannelChanged")) {
            ChannelInfo channel = NetcastChannelParser.parseRawChannelData(handler.getJSONObject());

            Log.d(Util.T, "Channel Changed: " + channel.getNumber());

            for (URLServiceSubscription<?> sub: subscriptions) {
                if (sub.getTarget().equalsIgnoreCase("ChannelChanged")) {
                    for (int i = 0; i < sub.getListeners().size(); i++) {
                        @SuppressWarnings("unchecked")
                        ResponseListener<Object> listener = (ResponseListener<Object>) sub.getListeners().get(i);
                        Util.postSuccess(listener, channel);
                    }
                }
            }
        }
        else if (body.contains("KeyboardVisible")) {
            boolean focused = false;

            TextInputStatusInfo keyboard = new TextInputStatusInfo();
            keyboard.setRawData(handler.getJSONObject());

            try {
                JSONObject currentWidget = (JSONObject) handler.getJSONObject().get("currentWidget");
                focused = (Boolean) currentWidget.get("focus");
                keyboard.setFocused(focused);
            } catch (JSONException e) {
                e.printStackTrace();
            }

            Log.d(Util.T, "KeyboardFocused?: " + focused);

            for (URLServiceSubscription<?> sub: subscriptions) {
                if (sub.getTarget().equalsIgnoreCase("KeyboardVisible")) {
                    for (int i = 0; i < sub.getListeners().size(); i++) {
                        @SuppressWarnings("unchecked")
                        ResponseListener<Object> listener = (ResponseListener<Object>) sub.getListeners().get(i);
                        Util.postSuccess(listener, keyboard);
                    }
                }
            }
        }
        else if (body.contains("TextEdited")) {
            System.out.println("TextEdited");

            String newValue = "";

            try {
                newValue = handler.getJSONObject().getString("value");
            } catch (JSONException ex) {
                ex.printStackTrace();
            }

            Util.postSuccess(textChangedListener, newValue);
        }
        else if (body.contains("3DMode")) {
            try {
                String enabled = (String) handler.getJSONObject().get("value");
                boolean bEnabled;

                bEnabled = enabled.equalsIgnoreCase("true");

                for (URLServiceSubscription<?> sub: subscriptions) {
                    if (sub.getTarget().equalsIgnoreCase("3DMode")) {
                        for (int i = 0; i < sub.getListeners().size(); i++) {
                            @SuppressWarnings("unchecked")
                            ResponseListener<Object> listener = (ResponseListener<Object>) sub.getListeners().get(i);
                            Util.postSuccess(listener, bEnabled);
                        }
                    }
                }
            } catch (JSONException e) {
                e.printStackTrace();
            }
        }
    }
}

public void stop() {
    if (!running)
        return;

    if (welcomeSocket != null && !welcomeSocket.isClosed()) {
        try {
            welcomeSocket.close();
        } catch (IOException ex) {
            ex.printStackTrace();
        }
    }

    welcomeSocket = null;
    running = false;
}

