}

public  E remove(int index){
    if(index<0||index>=size)
        throw new IllegalArgumentException("Get failed.Illegal index.");
    //找到要删除的前一个节点
    Node prev=dummyHead;
    for(int i=0;i<index;i++)
        prev=prev.next;
    Node retNode=prev.next;
    prev.next=retNode.next;
    retNode.next=null;
    size--;
    return retNode.e;
}

