    }

    StarSystem sys = fl.isOrbiting() ? fl.system() : null;

    if (sys == null) {
        if (fl.hasDestination())
            g.drawImage(pl.sv.starBackground(this), 0, 0, null);
    }
    else {
        g.drawImage(pl.sv.starBackground(this), 0, 0, null);
