        String dest =  pl.sv.name(fl.destSysId());
        String str2 = dest.isEmpty() ? text("MAIN_FLEET_DEST_UNSCOUTED") : text("MAIN_FLEET_DESTINATION", dest);
        int sw2 = g.getFontMetrics().stringWidth(str2);
        g.drawString(str2, w-sw2-s10, y0);
