public final UnicornPointer writeStackBytes(byte[] data) {
    UnicornPointer pointer = allocate(data.length, "writeStackBytes: " + Hex.encodeHexString(data));
    assert pointer != null;
    pointer.write(0, data, 0, data.length);
    return pointer;
}

