    Optional<T> node = target.locate(key);
    node.ifPresent(n -> {
        int cnt = loads.getOrDefault(n, 0);
        loads.put(n, cnt + 1);
        Set<T> prev = keys.computeIfAbsent(key, k -> new HashSet<>());
