public static Node lowestAncestor1(Node head, Node o1, Node o2) {
	if (head == null) {
		return null;
	}
	// key的父节点是value
	HashMap<Node, Node> parentMap = new HashMap<>();
	parentMap.put(head, null);
	fillParentMap(head, parentMap);
	HashSet<Node> o1Set = new HashSet<>();
	Node cur = o1;
	o1Set.add(cur);
	while (parentMap.get(cur) != null) {
		cur = parentMap.get(cur);
		o1Set.add(cur);
	}
	cur = o2;
	while (!o1Set.contains(cur)) {
		cur = parentMap.get(cur);
	}
	return cur;
}

public static void fillParentMap(Node head, HashMap<Node, Node> parentMap) {
	if (head.left != null) {
		parentMap.put(head.left, head);
		fillParentMap(head.left, parentMap);
	}
	if (head.right != null) {
		parentMap.put(head.right, head);
		fillParentMap(head.right, parentMap);
	}
}

public static Node lowestAncestor2(Node head, Node o1, Node o2) {
	return process(head, o1, o2).ans;
}

public static Info process(Node X, Node o1, Node o2) {
	if (X == null) {
		return new Info(null, false, false);
	}
	Info leftInfo = process(X.left, o1, o2);
	Info rightInfo = process(X.right, o1, o2);
	boolean findO1 = X == o1 || leftInfo.findO1 || rightInfo.findO1;
	boolean findO2 = X == o2 || leftInfo.findO2 || rightInfo.findO2;
	// 	O1和O2最初的交汇点在哪？
	// 1) 在左树上已经提前交汇了
	// 2) 在右树上已经提前交汇了
	// 3) 没有在左树或者右树上提前交汇，O1  O2 全了
	// 4) 
	Node ans = null;
	if (leftInfo.ans != null) {
		ans = leftInfo.ans;
	}
	if (rightInfo.ans != null) {
		ans = rightInfo.ans;
	}
	if (ans == null) {
		if (findO1 && findO2) {
			ans = X;
		}
	}
	return new Info(ans, findO1, findO2);
}

public static Node generateRandomBST(int maxLevel, int maxValue) {
	return generate(1, maxLevel, maxValue);
}

public static Node generate(int level, int maxLevel, int maxValue) {
	if (level > maxLevel || Math.random() < 0.5) {
		return null;
	}
	Node head = new Node((int) (Math.random() * maxValue));
	head.left = generate(level + 1, maxLevel, maxValue);
	head.right = generate(level + 1, maxLevel, maxValue);
	return head;
}

public static Node pickRandomOne(Node head) {
	if (head == null) {
		return null;
	}
	ArrayList<Node> arr = new ArrayList<>();
	fillPrelist(head, arr);
	int randomIndex = (int) (Math.random() * arr.size());
	return arr.get(randomIndex);
}

public static void fillPrelist(Node head, ArrayList<Node> arr) {
	if (head == null) {
		return;
	}
	arr.add(head);
	fillPrelist(head.left, arr);
	fillPrelist(head.right, arr);
}

public static void main(String[] args) {
	int maxLevel = 4;
	int maxValue = 100;
	int testTimes = 1000000;
	for (int i = 0; i < testTimes; i++) {
		Node head = generateRandomBST(maxLevel, maxValue);
		Node o1 = pickRandomOne(head);
		Node o2 = pickRandomOne(head);
		if (lowestAncestor1(head, o1, o2) != lowestAncestor2(head, o1, o2)) {
			System.out.println("Oops!");
		}
	}
	System.out.println("finish!");
}

