    return binary;
}

static String binaryTo64(String binary) {
    StringBuffer sb = new StringBuffer();
    if (binary == null || "".equals(binary))
        return "";
    if ((binary.length() % 6) != 0)
        return "";
    for (int i = 0; i < binary.length(); i += 6) {
        sb.append(binaryTo64a(binary.substring(i, i + 6)));
    }
    return sb.toString();
}

