    conn.setAutoCommit(false);
    final DatabaseTransOperator transOperator = new DatabaseTransOperator(this.queryRunner,
        conn);
    final T res = operations.execute(transOperator);
    conn.commit();
    return res;
  } catch (final SQLException ex) {
