public static boolean isPrimitiveDesc(String desc) {
	if(desc.length() != 1) {
		return false;
	}
	switch(desc.charAt(0)) {
		case 'Z':
		case 'C':
		case 'B':
		case 'S':
		case 'I':
		case 'F':
		case 'J':
		case 'D':
