public void repeatPlus() {
    NFAState newStart = new NFAState();
    NFAState newEnd = new NFAState();
    newStart.addNext(Constant.EPSILON, this.start);
    end.addNext(Constant.EPSILON, newEnd);
    end.addNext(Constant.EPSILON, start);
    this.start = newStart;
    this.end = newEnd;
}

