private static boolean isCanonical(byte[] sigs) {
    return (sigs[0] & 0x80) == 0
            && !(sigs[0] == 0 && ((sigs[1] & 0x80) == 0))
            && (sigs[32] & 0x80) == 0
            && !(sigs[32] == 0 && ((sigs[33] & 0x80) == 0));
}

public int getId() {
    return CONSTANTS.METHODS.SIGN;
}

public Intercept getIntercept() {
    return new InterceptImpl();
